import { ColumnFilter } from "./ColumnFilter"

export const COLUMNS = [
    {
        Header: 'Serial No.',
        accessor: 'sno'
    },
    {
        Header: 'Customer name',
        accessor: 'customer name',
        Filter: ColumnFilter
    },
    {
        Header: 'Age',
        accessor: 'age'
    },
    {
        Header: 'Phone',
        accessor: 'phone'
    },
    {
        Header: 'Location',
        accessor: 'location',
        Filter: ColumnFilter
    }
]
